import std.algorithm.comparison : equal;
import std.bigint;

auto s = BigInt(1_000_000_000_000);
auto e = BigInt(1_000_000_000_003);
auto r = iota(s, e);
assert(r.equal([
    BigInt(1_000_000_000_000),
    BigInt(1_000_000_000_001),
    BigInt(1_000_000_000_002)
]));

